  private static int getIdByName(String resType, String resName)
  {
    Context context = UnityPlayer.currentActivity;

    return context.getResources().getIdentifier(resName, resType, context.getPackageName());
  }

  public static int[] getIdsByName(String className, String name) {
    Context context = UnityPlayer.currentActivity;
    String packageName = context.getPackageName();
    Class r = null;
    int[] ids = null;
    try {
      r = Class.forName(packageName + ".R");

      Class[] classes = r.getClasses();
      Class desireClass = null;

      for (int i = 0; i < classes.length; i++) {
        if (classes[i].getName().split("\\$")[1].equals(className)) {
          desireClass = classes[i];
          break;
        }
      }

      if ((desireClass != null) && (desireClass.getField(name).get(desireClass) != null) && (desireClass.getField(name).get(desireClass).getClass().isArray()))
        ids = (int[])desireClass.getField(name).get(desireClass);
    }
    catch (ClassNotFoundException e) {
      e.printStackTrace();
    } catch (IllegalArgumentException e) {
      e.printStackTrace();
    } catch (SecurityException e) {
      e.printStackTrace();
    } catch (IllegalAccessException e) {
      e.printStackTrace();
    } catch (NoSuchFieldException e) {
      e.printStackTrace();
    }

    return ids;
  }

